description:
I've always had a thing for Ariella Ferrera and tonight I finally get to meet her. She stops by my hotel room and calms my nerves, as I have never done this before. She knows that I travel a lot so she role plays for me one of my fantasies: sex with a flight attendant. She gets all dressed up and and makes sure that tonight I become a semi member of the mile high club.


